import React from "react";

import { motion } from "framer";

import "./Logo.css";
import engranaje from "../../images/engranaje.png";

const Logo = () => {
  return (
    <div className="d-flex d-flex flex-column align-items-center bg-light justify-content-center p-2">
      <motion.img
        animate={{ rotate: 360 }}
        transition={{ loop: Infinity, duration: 5 }}
        src={engranaje}
        alt="engranaje de mi logo"
      />
    </div>
  );
};

export default Logo;
